Very HQ very rare promo music video. &quot;Mista Bone&quot; is a single by Great White from ...Twice Shy, the fourth studio album released by the American hard rock band Great White. It was released in 1989 and contained the biggest hits of their career, a cover of Ian Hunter's &quot;Once Bitten, Twice Shy&quot; and &quot;The Angel Song&quot;, which reached No. 5 and No. 30 on the Billboard Hot 100, respectively. Another single, &quot;House of Broken Love,&quot; was inspired by the painful relationship break-ups that vocalist Jack Russell and guitarist Mark Kendall had recently gone through. The album was certified Double Platinum in September 1989.

Great White is an American hard rock band, formed in Los Angeles in 1978. The band gained popularity during the 1980s and early 1990s. The band released several albums in the late 1980s and gained airplay on MTV with music videos for songs like &quot;Once Bitten, Twice Shy&quot;. The band reached their peak popularity with the album ...Twice Shy in 1989.

The band continued to release new material into the 1990s, although none of their material charted in the United States. In 2003, the band made headlines when The Station nightclub fire led to the deaths of 100 people in West Warwick, Rhode Island, including the band's guitarist Ty Longley, who had been a member of the band for three years. Great White made a comeback in 2007 with the release of a new album and an accompanying tour.
